export var Placement;
(function (Placement) {
    Placement["TOP"] = "TOP";
    Placement["TOP_LEFT"] = "TOP_LEFT";
    Placement["TOP_RIGHT"] = "TOP_RIGHT";
    Placement["BOTTOM"] = "BOTTOM";
    Placement["BOTTOM_LEFT"] = "BOTTOM_LEFT";
    Placement["BOTTOM_RIGHT"] = "BOTTOM_RIGHT";
    Placement["LEFT"] = "LEFT";
    Placement["LEFT_TOP"] = "LEFT_TOP";
    Placement["LEFT_BOTTOM"] = "LEFT_BOTTOM";
    Placement["RIGHT"] = "RIGHT";
    Placement["RIGHT_TOP"] = "RIGHT_TOP";
    Placement["RIGHT_BOTTOM"] = "RIGHT_BOTTOM";
    Placement["CENTER"] = "CENTER";
})(Placement || (Placement = {}));
